import React, { Component } from 'react';
import { Text, View } from 'react-native';

class Home extends Component {
    render() {
        return (
            <SafeAreaView style={styles.root}>
                {/*<Login />	*/}
                <View>
                    <Text>Home Screen</Text>
                </View>
            </SafeAreaView>
        );
    }
}

const styles = StyleSheet.create({
    root: {
        flex: 1,
        backgroundColor: '#ffcfe6',
    }

});

export default Home
